import styles from "./NewUser.module.css";

const NewUser = (props) => {
  
  return (
    <div>
      {props.onNewUser.map((user) => (
        <input
          className={styles.input}
          type="text"
          value={`${user.username} (${user.age} years old)`}
          onClick={props.deleteHandler}
          key={Math.random()}
        />
      ))}
    </div>
  );
};
export default NewUser;
